import React from 'react';

const FuniroFurnitureGallery = () => {
  // Array of image URLs provided by the user
  const imageUrls = [
    'public\Rectangle 36.png',
    'public\Rectangle 37.png',
    'public\Rectangle 38.png',
    'public\Rectangle 39.png',
    'public\Rectangle 40.png',
    'public\Rectangle 41.png',
    'public\Rectangle 43.png',
    '',
    '',
    '',
    '',
   
  ];

  return (
    <div className="funiro-furniture-gallery">
      <h2>Share your setup with #FuniroFurniture</h2>
      <div className="gallery">
        {imageUrls.map((imageUrl, index) => (
          <img
            key={index}
            src={imageUrl}
            alt={`Funiro Furniture ${index + 1}`}
            // Add inline styles to set different sizes for each image
            style={{
              width: `${Math.floor(Math.random() * (300 - 200) + 200)}px`, // Random width between 200px and 300px
              height: 'auto', // Maintain aspect ratio
              margin: '10px', // Add margin between images
            }}
          />
        ))}
      </div>
    </div>
  );
};

export default FuniroFurnitureGallery;
